def find_first_warning_moment(n, m, log_stream):
    months = [0, 31, 29, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31]
    pref = [0]
    for i in range(1, 13):
        pref.append(pref[i - 1] + months[i])
    store = []
    for message in log_stream:
        date = int(message[8:10]) + pref[int(message[5:7]) - 1]
        time = date * 24 * 60 * 60 + int(message[11:13]) * 60 * 60 + int(message[14:16]) * 60 + int(message[17:19])
        store.append(time)
    now = 1
    while now < len(store):
        if now >= m - 1:
            prev = now - (m - 1)
            if store[now] - store[prev] < n:
                return log_stream[now][:19]
        now += 1
    return -1

